import React from 'react';

interface data {
    username : string;
    role :string;
}

export default class Welcome extends React.Component<any> {

    constructor(props: data){
        super(props);
        this.state ={
            username: '',
            role: '',
        }
    }
    render(){
        return(
            <>
            <div className="logoo"> 
                <span>
                    Welcome {this.props.username}
                </span>
                <span className="farmost">
                    role: {this.props.role}
                </span> 
                </div>
            </>
        )
    }
}
